      SELECT ALL col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + ( - - col0 ) * col2 * - 69 * - 44 / - col0 + col1 / col1 * - + col2 BETWEEN NULL AND - col2;
  - name: tab2

outputs:
  - name: q1999.out
    data: |
